records.addlTxt:
Defendant Steven A Moore in court with attorney Reyna Ivonne Morales.  Joy Hammond appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 60 DAYS in the House of Correction with credit for 6 days time served.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:  
*  AODA assessment/treatment deemed appropriate;
*  Mental health evaluation/treatment deemed appropriate;
*  Take only prescribed medications;
*  Maintain full time employment;
*  Commit no new crimes;
*  Referred to the Mental Health Unit of the probation department;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.  

Notice of Right to Seek Postconviction Relief received and filed.
